/**
 * Called when an error occurs in flash client library
 *
 * @param {string} msg An error message
 */
function error(msg) {
    alert(msg);
}
  
/**
 * Function called when a user want to display a tag's description on the map
 * Redirect the user to the wiki page of the selected tag
 * 
 * @param args {array} arguments array, here only one argument is used, the selected tag
 */
function DisplayTag(args) {
    var redirectUrl = '$xwiki.getURL("Main.Tags", "view", "do=viewTag&tag=")' + encodeURIComponent(args[0]);
    window.location.href = redirectUrl;
}
     
/**
 * Function called when a user want to have more information about an extension
 * Redirect the user to the wiki page of the selected extension
 * 
 * @param args {array} arguments array, here only one argument is used, the selected extension name
 */  
function DisplayExtension(args) {
    var redirectUrl = '/' + XWiki.webapppath + XWiki.servletpath + 'view/Extension/' + encodeURIComponent(args[0]);
    window.location.href = redirectUrl;
}

