    /**
     * Get the map div container on the page
     * @return the map div container dom element
     */
    function getMap() {
        if (navigator.appName.indexOf("Microsoft") !=-1) {
            return window["jmi-flex"];
        }
        else {
            return document["jmi-flex"];
        }
    }

    /**
     * Function called when a user focus on a node 
     * Get a new map with the selected element centered
     * 
     * @param args {array} arguments array, here only one argument is used, the selected node id (either a tag or an extenstion)
     */
    function Discover(args) {
        var parameters = {};
        parameters["attributeId"] = args[0];
        parameters["analysisProfile"] = "DiscoveryProfile";
        parameters["xwikiurl"] = "$xcontext.macro.params.xwikiurl";
        #if($xcontext.macro.params.xwikilogin)
            parameters["xwikilogin"] = "$xcontext.macro.params.xwikilogin";
        #end
        #if($xcontext.macro.params.xwikipassword)
            parameters["xwikipassword"] = "$xcontext.macro.params.xwikipassword";
        #end
        getMap().compute(parameters);
    }
 
    /**
     * Function called when a user focus on a link
     * Get a new map with the selected element highlighted
